INSERT INTO `games` (`id`, `nom`, `genre`, `plate-forme`, `date-sortie`, `trailer`, `cover`, `synopsis`) VALUES
(1, 'Factorio', 'Indie, Simulation, Strategy', 'PC, Mac', '2020-08-14', 'https://www.youtube.com/embed/BqaAjgpsoW8', , 'You will be mining resources, researching technologies, building infrastructure, automating production and fighting enemies. Use your imagination to design your factory, combine simple elements into ingenious structures, apply management skills to keep it working and finally protect it from the creatures who don\'t really like you.');
INSERT INTO `games` (`id`, `nom`, `genre`, `plate-forme`, `date-sortie`, `trailer`, `cover`, `synopsis`) VALUES
(2, 'The Last of Us II', 'Adventure, Shooter', 'PS4', '2020-06-19', 'https://www.youtube.com/embed/qPNiIeKMHyg', , 'Set 5 years after the events of The Last of Us, we see the return of Joel and Ellie. Driven by hatred, Ellie sets out for Seattle to serve justice. However, she begins to wonder what justice really means.');
INSERT INTO `games` (`id`, `nom`, `genre`, `plate-forme`, `date-sortie`, `trailer`, `cover`, `synopsis`) VALUES
(3, 'Valorant', 'Shooter, Tactical', 'PC', '2020-06-02', 'https://www.youtube.com/embed/e_E9W2vsRbQ', , 'Imagine this: tactical shooter meets hypernatural powers. Everyone’s got guns and a unique set of abilities, so how do you beat someone with the speed of wind? Use your own moves to outplay them and beat them to the shot. VALORANT is a game for bold strategists who dare to make the unexpected play, because if it wins, it works.\r\n');
INSERT INTO `games` (`id`, `nom`, `genre`, `plate-forme`, `date-sortie`, `trailer`, `cover`, `synopsis`) VALUES
(4, 'Madden NFL 21: Deluxe Edition', 'Sport', 'Xbox, PS4, PC', '2020-08-25', 'https://www.youtube.com/embed/kfEUX1fVy5A', , 'Rise to fame in Madden NFL 21. A new generation is leaving its mark on the NFL. Will you rise to the occasion? Change the game, and take control of your own legacy.\r\n\r\nMadden NFL 21 - Deluxe Edition includes:\r\n- 3-day early access\r\n- 7 MUT Gold Team Fantasy Packs');
INSERT INTO `games` (`id`, `nom`, `genre`, `plate-forme`, `date-sortie`, `trailer`, `cover`, `synopsis`) VALUES
(5, 'PGA Tour 2K21', 'Simulation, Sports', 'Xbox, Pc, PS4, Switch', '2020-08-21', 'https://www.youtube.com/embed/6RI2ukvIcT4', , 'Play against the pros. Play with your crew. In PGA TOUR 2K21, you can play by the rules or create your own featuring a new PGA TOUR Career Mode, licensed courses and more!');
INSERT INTO `games` (`id`, `nom`, `genre`, `plate-forme`, `date-sortie`, `trailer`, `cover`, `synopsis`) VALUES
(6, 'Fast & Furious: Crossroads', 'Racing', 'Xbox, PS4, PC', '2020-08-07', 'https://www.youtube.com/embed/OpWGH6X3w1s', , 'Gear up for an epic new chapter in the Fast & Furious saga with high-speed heists, cinematic nonstop action, and adrenaline-fueled stunts in exotic locations. Join longtime family and a tough new crew to hunt down an international crime syndicate and bring them to street justice.\r\n');
INSERT INTO `games` (`id`, `nom`, `genre`, `plate-forme`, `date-sortie`, `trailer`, `cover`, `synopsis`) VALUES
(7, 'Final Fantasy VII Remake', 'Adventure, RPG', 'PS4', '2020-04-10', 'https://www.youtube.com/embed/seLyp6fi3wI', , 'A spectacular re-imagining of one of the most visionary games ever, Final Fantasy VII Remake rebuilds and expands the legendary RPG for today. The first game in this project will be set in the eclectic city of Midgar and presents a fully standalone gaming experience.\r\n');
INSERT INTO `games` (`id`, `nom`, `genre`, `plate-forme`, `date-sortie`, `trailer`, `cover`, `synopsis`) VALUES
(8, 'Black Mesa', 'Adventure, Indie, Platform, Shooter', 'PC', '2020-03-06', 'https://www.youtube.com/embed/YkBrNGeFwoU', , 'Black Mesa is a re-envisioning of Valve Software\'s classic science fiction first person shooter, Half-Life. Powered by Source Engine, You will re-visit the inaugural role of Gordon Freeman and his memorable journey through the Black Mesa Research Facility. Expect detailed environments to explore, a huge cast of characters and experimental weaponry. All-new music, voice acting, choreography and added dialogue give way to a more expansive and immersive experience than ever before.');
INSERT INTO `games` (`id`, `nom`, `genre`, `plate-forme`, `date-sortie`, `trailer`, `cover`, `synopsis`) VALUES
(9, 'Stream Racer', 'Racing', 'PC', '2020-06-19', 'https://www.youtube.com/embed/MpDLlGcLeKo', , 'Stream Racer is a racing game for Twitch.tv streamers. Host your own races, stream it on Twitch.tv and have your viewers join you. Engage more with your viewers by giving them a racing car on your stream. Get ready for a hilariously chaotic time for your viewers and you!\r\n');
INSERT INTO `games` (`id`, `nom`, `genre`, `plate-forme`, `date-sortie`, `trailer`, `cover`, `synopsis`) VALUES
(10, 'Trackmania', 'Arcade, Racing, Sports', 'PC', '2020-07-01', 'https://www.youtube.com/embed/yjmzsOOrEnQ', , 'Trackmania, the racing franchise from Ubisoft Nadeo, is back with the most compelling remake of Trackmania Nations.\r\n');
INSERT INTO `games` (`id`, `nom`, `genre`, `plate-forme`, `date-sortie`, `trailer`, `cover`, `synopsis`) VALUES
(11, 'Desperados 3', 'Strategy, Tactical', 'Xbox, PC, PS4', '2020-06-16', 'https://www.youtube.com/embed/WshQo48iu2E', , 'The Wild West. A place where the law is made by those with a gun in their hands, and is enforced by the henchmen at their command. A place where death is no stranger and the undertakers are working overtime… especially when people start playing Desperados III. This real-time tactics game, developed by German game studio Mimimi Games (Shadow Tactics: Blades Of The Shogun), lets players command a band of Desperados led by fan-favourite gunslinger John Cooper.\r\n');
INSERT INTO `games` (`id`, `nom`, `genre`, `plate-forme`, `date-sortie`, `trailer`, `cover`, `synopsis`) VALUES
(12, 'Dreams', 'Arcade', 'PS4', '2020-02-14', 'https://www.youtube.com/embed/W8qWEDsuaIA', , 'It’s both a playful sandbox game and an endless explorative journey where players can create and share their dreams, and then surf an endless dreamiverse of single assets, games, animation, music and everything in between. The thing that unites everything is the feeling of being in a dream.\r\n');
INSERT INTO `games` (`id`, `nom`, `genre`, `plate-forme`, `date-sortie`, `trailer`, `cover`, `synopsis`) VALUES
(13, 'Paper Mario: The Origami King', 'Adventure, RPG', 'PS4', '2020-06-17', 'https://www.youtube.com/embed/FX6DTLcWUdY', , 'Join Mario and his new companion Olivia on a comedic adventure that will take you to the far corners of a papercraft world in Paper Mario: The Origami King on Nintendo Switch!\r\n\r\nFace off against the Origami King and his army of paper invaders, team up with some extraordinary companions and master magical powers on your quest to save the world.\r\n\r\n\r\nUnwrap an epic quest!\r\n\r\nTravel the land, repair the damage done by the Folded Soldiers and rescue Toads trapped in all manner of wacky scrapes!\r\n\r\nWith the help of Olivia’s paper-folding powers, use the far-reaching 1,000 Fold Arms and other paper transformations to save those imprisoned by the Origami King’s henchmen, and help restore peace to the world.\r\n\r\nPut a stop to King Olly\'s plans by engaging in battles which will put both your tactical thinking and puzzle solving skills to the test – against his origami army, as well as humongous bosses under his command!');
INSERT INTO `games` (`id`, `nom`, `genre`, `plate-forme`, `date-sortie`, `trailer`, `cover`, `synopsis`) VALUES
(14, 'Doom Eternal', 'Shooter', 'Xbox, PC, PS4, Switch', '2020-03-20', 'https://www.youtube.com/embed/2HOClc6Svg4', , 'Developed by id Software, DOOM Eternal is the direct sequel to DOOM (2016). Experience the ultimate combination of speed and power with the next leap in push-forward, first-person combat.\r\n\r\nAs the DOOM Slayer, return to take your vengeance against the forces of Hell. Set to an all-new pulse pounding soundtrack composed by Mick Gordon, fight across dimensions as you slay new and classic demons with powerful new weapons and abilities.');
INSERT INTO `games` (`id`, `nom`, `genre`, `plate-forme`, `date-sortie`, `trailer`, `cover`, `synopsis`) VALUES
(15, 'The Ghost of Tsushima', 'Adventure', 'PS4', '2020-07-17', 'https://www.youtube.com/embed/k3CqzUCNDjU', , 'The year is 1274. Samurai warriors are the legendary defenders of Japan — until the fearsome Mongol Empire invades the island of Tsushima, wreaking havoc and conquering the local population. As one of the last surviving samurai, you rise from the ashes to fight back. But, honorable tactics won’t lead you to victory. You must move beyond your samurai traditions to forge a new way of fighting — the way of the Ghost — as you wage an unconventional war for the freedom of Japan.');
INSERT INTO `games` (`id`, `nom`, `genre`, `plate-forme`, `date-sortie`, `trailer`, `cover`, `synopsis`) VALUES
(16, 'Animal Crossing: New Horizons', 'Simulation', 'Switch', '2020-03-20', 'https://www.youtube.com/embed/aIDu18n3umY', , 'Escape to a deserted island and create your own paradise as you explore, create, and customize in the Animal Crossing: New Horizons game. Your island getaway has a wealth of natural resources that can be used to craft everything from tools to creature comforts. You can hunt down insects at the crack of dawn, decorate your paradise throughout the day, or enjoy sunset on the beach while fishing in the ocean. The time of day and season match real life, so each day on your island is a chance to check in and find new surprises all year round.');
INSERT INTO `games` (`id`, `nom`, `genre`, `plate-forme`, `date-sortie`, `trailer`, `cover`, `synopsis`) VALUES
(17, 'Call of Duty: Modern Warfare 2 Campaign Remastered', 'Shooter', 'Xbox, PC, PS4', '2020-03-31', 'https://www.youtube.com/embed/x993FRC4rXA', , 'The Call of Duty: Modern Warfare 2 Campaign has been fully remastered with improved textures, animations, physically based rendering, high-dynamic range lighting, and much more.  Experience classic missions including Cliffhanger, The Gulag, and Whiskey Hotel as you join Soap, Price, Ghost and the rest of Task Force 141 in the globe-spanning fight to restore order to the world.\r\n');
INSERT INTO `games` (`id`, `nom`, `genre`, `plate-forme`, `date-sortie`, `trailer`, `cover`, `synopsis`) VALUES
(18, 'Resident Evil 3', 'Adventure, Shooter', 'Xbox, PS4, PC', '2020-03-03', 'https://www.youtube.com/embed/Wghn3tYYVNw', , 'Jill Valentine is one of the last remaining people in Raccoon City to witness the atrocities Umbrella performed. To stop her, Umbrella unleashes their ultimate secret weapon: Nemesis! Also includes Resident Evil Resistance, a new 1 vs 4 online multiplayer game set in the Resident Evil universe.\r\n');
INSERT INTO `games` (`id`, `nom`, `genre`, `plate-forme`, `date-sortie`, `trailer`, `cover`, `synopsis`) VALUES
(19, 'Deep Rock Galactic', 'Adventure, Indie, Shooter', 'PS4', '2020-05-13', 'https://www.youtube.com/embed/llqM5lLVnYg', , 'DEEP ROCK GALACTIC is a first-person co-operative sci-fi shooter for up to 4 players, featuring fully procedural and destructible environments to explore, mine, and explode your way through to reach your objectives. As a team of veteran dwarven space miners, you must take on perilous missions for the interplanetary mining corporation DEEP ROCK GALACTIC and go where no-one else dares - into the deepest, most dangerous cave systems of the most hostile planet ever discovered.\r\n');
INSERT INTO `games` (`id`, `nom`, `genre`, `plate-forme`, `date-sortie`, `trailer`, `cover`, `synopsis`) VALUES
(20, 'Carrion', 'Adventure, Indie', 'Xbox, PC, Mac, Switch', '2020-07-23', 'https://www.youtube.com/embed/jZENtOGdMkc', , 'Carrion is a reverse horror game in which you assume the role of an amorphous alien being. Use your unique otherworldly abilities to your advantage and hunt down your prey!\r\n');
INSERT INTO `games` (`id`, `nom`, `genre`, `plate-forme`, `date-sortie`, `trailer`, `cover`, `synopsis`) VALUES
(21, 'Ostriv', 'Indie, Simulation, Strategy', 'PC', '2020-03-19', 'https://www.youtube.com/embed/Yd11wKe5lBM', , 'Ostriv is a city-building game that puts you in a role of a governor of an 18th century Ukrainian town to challenge your creative skills and management abilities.\r\n\r\nOstriv aims to raise the bar of city-building experience by adding a huge amount of possibilities and removing annoying limitations. It allows for truly organic town layouts without the grid and angle restrictions on a three-dimensional landscape. The goal is to make player\'s creations to become alive and believable communities where real-life problems would arise, thus making the late game a new challenge rather than a repetitive chore.');
INSERT INTO `games` (`id`, `nom`, `genre`, `plate-forme`, `date-sortie`, `trailer`, `cover`, `synopsis`) VALUES
(22, 'Pokémon Mystery Dungeon: Rescue Team DX', 'Adventure, RPG', 'Switch', '2020-03-06', 'https://www.youtube.com/embed/2R_1HEbxYhA', , 'You can meet and recruit Pokémon in a dungeon-crawling adventure within their world! Build a rescue team to take on mysterious, changing dungeons and strategically plan your moves as you venture forth to make the Pokémon world a safer place…and uncover your true purpose along the way.\r\n\r\nAs you recruit Pokémon, these trusty teammates will need somewhere to stay, so build camps to house, manage, and strengthen your Pokémon friends. Think hard about who is right for the job and how to approach each mysterious dungeon as you prepare a rescue team. You’ll move a single square at a time or use Auto mode to speed up movement until you engage other Pokémon in turn-based battles—but don’t forget about Pokémon strengths and weaknesses! This version adds gorgeous watercolor-inspired graphics, and more! Get comfortable in being a Pokémon, there’s a lot of work to do.');
INSERT INTO `games` (`id`, `nom`, `genre`, `plate-forme`, `date-sortie`, `trailer`, `cover`, `synopsis`) VALUES
(23, 'Retrowave', 'Indie, Racing, Simulation', 'PC', '2020-03-06', 'https://www.youtube.com/embed/m9T3oJ0AbMo', , 'Neon lights, palm trees, synthwave, 80\'s supercars speeding down an endless highway... Welcome to the world of Retrowave!\r\n');
INSERT INTO `games` (`id`, `nom`, `genre`, `plate-forme`, `date-sortie`, `trailer`, `cover`, `synopsis`) VALUES
(24, 'The Complex', 'Adventure', 'Xbox, PC, PS4, Switch', '2020-03-31', 'https://www.youtube.com/embed/1flPHceAsXY', , 'The Complex is an upcoming cinematic FMV sci-fi thriller for PC and console.\r\n\r\nAfter a major bio-weapon attack on London, two scientists find themselves in a locked-down laboratory with time, and air, running out. With over 100 interactive choices, you will attempt to escape the lab with several different endings that are discovered based on your decisions and your relationships with other characters.\r\n\r\nThe Complex is a female-driven production written by Lynn Renee Maxcy, part of the Emmy award-winning writing team from The Handmaid’s Tale. The interactive movie stars Michelle Mylett (Letterkenny, Bad Blood), Kate Dickie (Game of Thrones, The Witch) and Al Weaver (Grantchester). Actors also include Twitch streamer and Xbox UK presenter, Leah Viathan.');
INSERT INTO `games` (`id`, `nom`, `genre`, `plate-forme`, `date-sortie`, `trailer`, `cover`, `synopsis`) VALUES
(25, 'Unfortunate Spaceman', 'Indie', 'PC', '2020-06-12', 'https://www.youtube.com/embed/drpx06m5pU4', , 'Unfortunate Spacemen is a multiplayer game about space-based murder in space! Spacemen work diligently to be rescued from their failing outpost, but not everyone is who they claim to be...\r\n');
INSERT INTO `games` (`id`, `nom`, `genre`, `plate-forme`, `date-sortie`, `trailer`, `cover`, `synopsis`) VALUES
(26, 'Half-Life: Alyx', 'PC', 'Adventure, Puzzle, Shooter', '2020-03-23', 'https://www.youtube.com/embed/LTLotwKpLgk', , 'Half-Life: Alyx is Valve’s VR return to the Half-Life series. It’s the story of an impossible fight against a vicious alien race known as the Combine, set between the events of Half-Life and Half-Life 2.\r\n\r\nSet between the events of Half-Life and Half-Life 2, Alyx Vance and her father Eli mount an early resistance to the Combine\'s brutal occupation of Earth.');
INSERT INTO `games` (`id`, `nom`, `genre`, `plate-forme`, `date-sortie`, `trailer`, `cover`, `synopsis`) VALUES
(27, 'The Pedestrian', 'Adventure, Indie, Platform, Puzzle', 'PC, PS4, Mac', '2020-01-29', 'https://www.youtube.com/embed/gBp4UEBtQQA', , 'The Pedestrian is a 2.5D puzzle platformer that takes “puzzle platforming” literally. You play as The Pedestrian (aka the male bathroom symbol) who works in a restroom sign standing beside his Beloved (the female symbol). When she disappears, you must escape your day job and embark on a perilous journey where you progress by piecing the “sign world” back together in search of the one you love.\r\n');
INSERT INTO `games` (`id`, `nom`, `genre`, `plate-forme`, `date-sortie`, `trailer`, `cover`, `synopsis`) VALUES
(28, 'Xenoblade Chronicles: Definitive Edition', 'RPG', 'Switch', '2020-05-29', 'https://www.youtube.com/embed/nLEkwIvfOO4', , 'Discover the origins of Shulk as he and his companions clash against a seemingly-unstoppable mechanical menace. Wield a future-seeing blade, chain together attacks, and carefully position your party members in strategic, real-time combat as you journey across a massive world.\r\n\r\nDuring an attack from the mechanical invaders known as the Mechon, Shulk discovers that he can tap into the full power of a mysterious blade known as the Monado. With the mighty Monado in hand, Shulk sets out to defeat the Mechon once and for all.\r\n\r\nIn addition to the Mechon, you’ll run into wildlife that ranges from docile to deadly. Keep an eye on what attracts monsters’ attention to avoid unwanted conflict…or try your hand at bringing down an ultra-powerful Unique Monster.\r\n\r\nUpgrade your party as you progress through the adventure by selecting equipment, enhancing weapon skills, and using benefit-granting gems. Put your dependable companions to work by filling the party gauge to trigger a Chain Attack and attack enemies in quick succession!');
INSERT INTO `games` (`id`, `nom`, `genre`, `plate-forme`, `date-sortie`, `trailer`, `cover`, `synopsis`) VALUES
(29, 'All over', 'Adventure, Indie, Puzzle, RPG', 'PC', '2020-04-06', 'https://www.youtube.com/embed/js3wuQ_Nr_o', , 'An indie Action RPG/adventure/puzzle Complete story-based quests, solve puzzles, use your sword and spells to fight and gain loot from monsters. Gather resources to build and craft potions and items. Fight legendary bosses.\r\n\r\n\r\nKey Features\r\n\r\nQuests - Dozens of story quests and side missions.\r\nStory - In your journey, you will reveal your true identity while helping NPCs & magical creatures with their evil ruler\r\nPuzzles - Solve mind-blowing puzzles as you travel to mysterious places\r\nAction - Cast powerful spells, equip your legendary weapon and armor to help you fight your battles.\r\nLoot & Items - Find gold, potions, magical items, and weapons to aid you on your quest.\r\nMonsters - Fight or help different monsters and NPCs in Abelon. Win to gain XP and treasures or try to escape and live to fight another day\r\nResource gathering - Mining, woodcutting, herbs, and more...\r\nNight & Day - Go out at midnight with a torch or fight your way during the day. Abelon changes with time.\r\nBoss fights - Go into the depth of the dungeons and fight badass bosses.\r\nLevel up - Gain XP and grow in strength\r\nSteam achievements - Growing list of steam achievements.\r\n');
INSERT INTO `games` (`id`, `nom`, `genre`, `plate-forme`, `date-sortie`, `trailer`, `cover`, `synopsis`) VALUES
(30, 'Invasion Machine', 'Indie, Simulation, Strategy, Tactical', 'PC', '2020-02-26', 'https://www.youtube.com/embed/YpzkmvIq1OA', , 'Invasion Machine is a modern warfare, counter-insurgency blend of a sandbox and RTS. Your goal is to command troops in an occupied province, in an effort of bringing back peace and order. Kill your enemies, help the civilian population, preserve the resources and the lives of your own soldiers.\r\n');
INSERT INTO `games` (`id`, `nom`, `genre`, `plate-forme`, `date-sortie`, `trailer`, `cover`, `synopsis`) VALUES
(31, 'Control: The Foundation', 'Adventure, Shooter', 'Xbox, PC, PS4, ', '2020-03-26', 'https://www.youtube.com/embed/MNZ_dJ8ELZs', , 'The Foundation Expansion includes new story content and side missions as well as new weapons and mods inspired by the Oldest House\'s mysterious origins.\r\n');
INSERT INTO `games` (`id`, `nom`, `genre`, `plate-forme`, `date-sortie`, `trailer`, `cover`, `synopsis`) VALUES
(32, 'Yes, Your Grace', 'Adventure, RPG, Simulation, Strategy', 'Xbox, PC, Switch', '2020-03-06', 'https://www.youtube.com/embed/nKjJarr-cWE', , 'These are troubling times, Your Grace. The petitioners’ petty matters exceed our limited resources, to say nothing of the war. A careful balance must be struck. Your throne awaits.\r\n');
INSERT INTO `games` (`id`, `nom`, `genre`, `plate-forme`, `date-sortie`, `trailer`, `cover`, `synopsis`) VALUES
(33, 'Ori and the Will of the Wisps', 'Adventure, Platform', 'PC, Xbox', '2020-03-11', 'https://www.youtube.com/embed/NJoWjtp-EIc', , 'The little spirit Ori is no stranger to peril, but when a fateful flight puts the owlet Ku in harm’s way, it will take more than bravery to bring a family back together, heal a broken land, and discover Ori’s true destiny. From the creators of the acclaimed action-platformer Ori and the Blind Forest comes the highly anticipated sequel. Embark on an all-new adventure in a vast world filled with new friends and foes that come to life in stunning, hand-painted artwork. Set to a fully orchestrated original score, Ori and the Will of the Wisps continues the Moon Studios tradition of tightly crafted platforming action and deeply emotional storytelling.\r\n');
